def solve():
    s = "t12 t33 t30 t3 t16 t1 t23 t27 t13 t12 t3 t7 t35 t29 t35 t22 t0 t31 t13 t25 t20 t1 t3 t0 t3 t36 t36 t17 t30"

    def is_valid_grammar(grammar, input_string):
        """
        Checks if a given string is valid according to the given grammar.
        """
        try:
            # Build the parse tree
            parse_tree = build_parse_tree(grammar, input_string)

            # Use a stack to track the matches
            stack = []
            for node in parse_tree.nodes:
                if node.left is not None or node.right is not None:
                    stack.append(node)
                elif node.left == None and node.right == None:
                    stack.append(node)

            # Check if the string is part of the grammar
            if stack:
                return True
            else:
                return False
        except Exception as e:
            return False

    def build_parse_tree(grammar, input_string):
        """
        Builds a parse tree from the given grammar and input string.
        """
        parse_tree = {}

        for node in grammar.nodes:
            if node.left is not None:
                parse_tree[node.left] = node
            if node.right is not None:
                parse_tree[node.right] = node

        return parse_tree

    result = solve()
    print(result)

